const { PrismaClient } = require("@prisma/client");
const prisma = new PrismaClient();
const bcrypt = require("bcryptjs");

const hubControllers = require("../controllers/ajax/hub.controllers");
const masterHubControllers = require("../controllers/ajax/master_hub.controllers");
const masterSmokeControllers = require("../controllers/ajax/master_smoke.controllers");
const smokeControllers = require("../controllers/ajax/smoke.controllers");
const zoneControllers = require("../controllers/ajax/zone.controllers");

async function main() {
  // Create roles
  const roles = [
    { name: "guest", description: "Temporary account" },
    { name: "user", description: "General user account" },
    { name: "admin", description: "System administrator account" },
  ];

  for (const role of roles) {
    const existingRole = await prisma.role.findUnique({
      where: { name: role.name },
    });
    if (!existingRole) {
      await prisma.role.create({ data: role });
    }
  }

  // Create groups
  const groups = [
    { name: "general", description: "General group" },
    { name: "administrator", description: "System operator group" },
    { name: "jatujak", description: "Headquarters@Jatujak group" },
    { name: "rangsit", description: "Rangsit - Klong 5 group" },
    { name: "nyk", description: "Nakornnayok group" },
  ];

  for (const group of groups) {
    const existingGroup = await prisma.group.findUnique({
      where: { name: group.name },
    });
    if (!existingGroup) {
      await prisma.group.create({ data: group });
    }
  }

  // Create users
  const adminEmail = "admin@planetcloud.cloud";
  const existingAdmin = await prisma.user.findUnique({
    where: { email: adminEmail },
  });
  if (!existingAdmin) {
    const adminRole = await prisma.role.findUnique({
      where: { name: "admin" },
    });
    const adminGroup = await prisma.group.findUnique({
      where: { name: "administrator" },
    });

    await prisma.user.create({
      data: {
        name: "admin",
        roleId: adminRole.id,
        groupId: adminGroup.id,
        email: adminEmail,
        password: await bcrypt.hash("pca@1234", 10),
        image: "",
      },
    });
  }

  // Seed Ajax Users
  const ajaxUserEmail = "phichaiyut@planetcloud.cloud";
  const existingAjaxUser = await prisma.ajaxUser.findUnique({
    where: { email: ajaxUserEmail },
  });
  if (!existingAjaxUser) {
    await prisma.ajaxUser.create({
      data: {
        user_id: "632D64FE",
        user_role: "USER",
        name: "phichaiyut",
        email: ajaxUserEmail,
        password: "Planetcomm@123",
      },
    });
  }

  // Seed FloorPlan
  const floorPlans = [
    {
      name: "Head office, Nakhon Nayok",
      floor: "1",
      width: 1000,
      height: 700,
      description: "Main floor plan",
      img: "data:image/png;base64,",
    },
    {
      name: "Head office, Nakhon Nayok",
      floor: "2",
      width: 1000,
      height: 700,
      description: "Second floor plan",
      img: "data:image/png;base64,",
    },
    {
      name: "Khlong Ha Branch Office 1, Pathum Thani",
      floor: "1",
      width: 1000,
      height: 700,
      description: "Third floor plan",
      img: "data:image/png;base64,",
    },
    {
      name: "Khlong Ha Branch Office 2, Pathum Thani",
      floor: "1",
      width: 1000,
      height: 700,
      description: "Third floor plan",
      img: "data:image/png;base64,",
    },
    {
      name: "Chatuchak Branch Office, Bangkok",
      floor: "1",
      width: 785,
      height: 599,
      description: "Third floor plan",
      img: "data:image/png;base64,",
    },
  ];

  for (const floorPlan of floorPlans) {
    const existingFloorPlan = await prisma.floorPlan.findFirst({
      where: {
        name: floorPlan.name,
        floor: floorPlan.floor,
      },
    });

    if (!existingFloorPlan) {
      await prisma.floorPlan.create({ data: floorPlan });
    }
  }

  // Seed other entities through controllers
  await zoneControllers.ZoneRegister();
  await masterHubControllers.MasterHubRegister();
  await hubControllers.HubRegister();
  await masterSmokeControllers.MasterSmokeRegister();
  await smokeControllers.SmokeRegister();

  console.log("Database seeded successfully.");
}

main()
  .catch((e) => {
    console.error(e);
    process.exit(1);
  })
  .finally(async () => {
    await prisma.$disconnect();
  });
